import styled from "styled-components";

const FilterContainer = styled.div`
    margin-bottom: 56px;

    h3 {
        margin-top: 73px;
        font-size: 16px;
        font-weight: bold;
        color: #506784;
    }
`;
const Checkboxes = styled.div`
    display: flex;
`;

const Filter = () => {
    return (
        <FilterContainer>
            <h3>Filter by Alliances</h3>
            <Checkboxes></Checkboxes>
        </FilterContainer>
    );
};

export default Filter;
